INSERT INTO `sentence_master` (`id`, `start_location_id`, `end_location_id`, `sentence`, `is_active`, `created_time`) VALUES
(1, 1, 4, 'sdsadsadsdvcds sdvcds csv ds', 0, '2018-03-27 16:11:08'),
(2, 1, 3, 'On arrival at Jabalpur railway station/ Aorport ,We will be Pick up You and transfer  to Pachmarhi. Check-in to hotel and get freshen up, visit  Pandav Gufa Jata Shankar Handi Kho Priyadarshini Mahadev Gupt Mahadev after sightseeing come back to hotel .night stay at hotel', 1, '2018-04-03 06:37:04'),
(3, 3, 3, 'At morning After Breakfast move to Visit sightseeing  B Fall  Apsara vihar Silver Fall Amba Mai Begum Palace   Lake Boting  and back to hotel night stay at hotel', 1, '2018-04-03 06:38:16'),
(4, 3, 3, 'After Breakfast Move Out Visit sightseeing  Dutches Fall Eco Point Dhoopgarh And Night Stay at Pachmari', 1, '2018-04-03 06:41:26'),
(5, 3, 1, 'In This Morning After Breakfast checkout from Hotel Transfer to jabalpur on tha way visit Bhedaghat and drop to Jabalpur Railway Station with Happy Memories with Banjari MP Tours.', 1, '2018-04-03 06:42:46'),
(6, 9, 9, 'On arrival in Ujjain, check into hotel and proceed for the sightseeing tour of Ujjain. Ujjain is acknowledged for Kalidasa and its most popular composition, Meghdoot. It is also known as adobe for Lord Shiva where he has the power of the 12 Jyotirlingas. In our day tour itinerary, we will be covering the major tourist attractions of Ujjain such as the Mahakaleshwar Temple, Chintaman Ganesh, Bhartrihari Caves, Bade Ganeshji Ka Mandir, Pir Matsyendranath, Vedh Shala and Kaliadeh Palace. Thereafter, we will return back to our hotel and overnight stay', 1, '2018-04-03 16:36:39'),
(7, 9, 14, 'in Early morning get ready to attend Bhasmarti (Darshan at your own). After Breakfast move to visit Omkareshwar temple after darshan at omkareshwer come back to hotel . Over Night stay at Ujjain', 1, '2018-04-03 16:40:09'),
(8, 9, 3, 'In Morning Take train From Ujjain to Pipariya Railway station 12 PM Reach  Pipariya after reaching Pipariya  we will pickup you and transfer to pachmari after check in and fresh-up Take Rest and overnight stay at hotel', 1, '2018-04-03 16:56:35'),
(9, 3, 11, 'After Breakfast checkout from Hotel and drop to Pipariya Railway Station with Happy Memories with Banjari MP Tours.', 1, '2018-04-03 16:58:05'),
(10, 9, 9, 'On arrival in Ujjain, check into hotel and proceed for the sightseeing tour of Ujjain. Ujjain is also known as adobe for Lord Shiva where he has the power of the 12 Jyotirlingas. In our day tour itinerary, we will be covering the major tourist attractions of Ujjain such as the Mahakaleshwar Temple, Chintaman Ganesh, Bhartrihari Caves, Bade Ganeshji Ka Mandir, Pir Matsyendranath, Vedh Shala and Kaliadeh Palace. Thereafter, we will return back to our hotel and overnight stay', 1, '2018-04-03 17:00:59'),
(11, 21, 4, 'At morning Transfer Nagpur  to Kanha. Check-in the hotel, freshen-up and today we will enjoy “Evening Jungle Safari” (Optional) and back to hotel. Overnight stay at Kanha.', 1, '2018-04-04 05:30:31'),
(12, 4, 4, 'Today we enjoy the “Morning Jungle Gypsy Safari”. In the evening walk around the nearby villages and see the innocent tribes of India. Overnight stay at Kanha.', 1, '2018-04-04 05:31:26'),
(13, 4, 21, 'This morning after breakfast checkout From hotel and drop to Nagpur', 1, '2018-04-04 05:31:59'),
(14, 1, 4, 'On Arrival at Jabalpur Railway Station/Airport, you will be received and transferred to Kanha. Check-in the hotel, freshen-up and today we will enjoy “Evening Jungle Safari” (optional) and back to hotel. Overnight stay at Kanha.', 1, '2018-04-04 05:46:55'),
(15, 1, 1, 'On Arrival at Jabalpur Railway Station/Airport, you will be transferred to your hotel, check-in to hotel, freshen-up and move for Jabalpur Local Sightseeing Balancing Rock, Madan Mahal Fort, Tripur Sundari Temple, Bhedaghat, Dhuandhar Jalprapat. Overnight stay at Jabalpur.', 1, '2018-04-07 11:51:48'),
(16, 2, 2, 'On Arrival Bhopal Railway station we will pickup you and transfer  to Hotel after chicken  and fresh up take full day sightseeing in Bhopal and night stay at Bhopal', 1, '2018-04-09 12:50:23'),
(17, 2, 3, 'At Morning after breakfast checkout From hotel and transfer Pachmari and on arrival pachmari check in  in hotel and Take sightseeing', 1, '2018-04-09 13:53:58'),
(18, 1, 1, 'at morning after breakfast cheackout from hotel and drop to railway station', 1, '2018-04-09 13:56:44'),
(19, 3, 3, 'On Arrival pachmari by one vehicle  check in and fresh up at hotel then visit half day sightseeing by one and night stay at Pachmmari', 1, '2018-04-09 15:09:53'),
(20, 4, 1, 'after breakfast checkout from hotel and drop to jabalpur station', 1, '2018-04-25 14:05:13');
